import React from "react";

class MessageCard extends React.Component {
  render() {
    return (
      <div className="ui right aligned grid">
        <div className="left floated right aligned six wide column">
          <div className="ui segment">Left floated right aligned column</div>
        </div>
        <div className="right floated left aligned six wide column">
          <div className="ui segment">Right floated left aligned column</div>
        </div>
      </div>
    );
  }
}

export default MessageCard;
